״תכנית לאומית מקיפה להתחדשות עירונית שתביא תוך שנה להקמת 100 אלף יחידות דיור בתוך מרכזי הערים באמצעות עיבוי הרקמה העירונית הקיימת;

״הפעלת תכנית ממשלתית לבניית דיור להשכרה ארוכת טווח;

״החייאה מסיבית של הדיור הציבורי ושיפוץ מיידי של מלאי הדירות הקיימות;

״קידום תחבורה ציבורית יעילה, מהירה ומקיפה ומתן עדיפות להשקעה בתחבורה ציבורית על פני פיתוח תשתיות לתחבורה פרטית״

(מתוך התכנית הכלכלית של מרצ שהוצגה אתמול)

רק מרצ הציגה תכנית כלכלית מקיפה, קוהרנטית, שנובעת מתפיסת עולם ברורה שמחזירה את האחריות הציבורית על השירותים הציבוריים, שבולמת את מגמת ההפרטות ושמה דגש על ההוצאה הציבורית והאזרחית. 

אני גאה במיוחד בפרק הדיור והתחבורה ששם לראשונה בישראל את הצורך בהתחדשות עירונית ובחיזוק הערים ובהתבססות על תחבורה ציבורית במוקד הדיבור על משבר הדיור ויוקר המחיה. רק ככה נעשה ישראל טובה יותר. 

